const ListItem = (props) => {
  const { item } = props;
  return (
    <li className="list-group-item d-flex justify-content-between align-items-center">
      {item.place}
      {item.amount}
      {/* <span className="badge badge-primary badge-pill">{item.amount}</span> */}
    </li>
  );
};

export default ListItem;
